import React, { useState, useCallback } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { useCart } from '../context/CartContext';
import NotificationBell from './NotificationBell';
import UserSidebar from './UserSidebar';

const Navbar = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const { isAuthenticated } = useAuth();
  const { getCartCount } = useCart();
  const navigate = useNavigate();
  const location = useLocation();

  const handleLogoClick = () => {
    navigate('/');
  };

  const isActive = (path) => {
    return location.pathname === path;
  };

  const closeSidebar = useCallback(() => setSidebarOpen(false), []);

  return (
    <>
      <nav className="navbar">
        <div className="container">
          <div className="nav-wrapper">

            {/* Logo */}
            <div className="logo" onClick={handleLogoClick}>
              <img
                src="/images/logo.png"
                alt="RailBite Logo"
                style={{ width: '135px', height: '45px', objectFit: 'contain', cursor: 'pointer' }}
              />
            </div>

            {/* Navigation Menu (desktop only) */}
            <ul className="nav-menu" id="navMenu">
              <li>
                <Link to="/" className={isActive('/') ? 'active' : ''}>
                  Home
                </Link>
              </li>
              <li>
                <Link to="/about" className={isActive('/about') ? 'active' : ''}>
                  About Us
                </Link>
              </li>
              <li>
                <Link to="/contact" className={isActive('/contact') ? 'active' : ''}>
                  Contact
                </Link>
              </li>
              {isAuthenticated() && (
                <li>
                  <Link
                    to="/order-history"
                    className={isActive('/order-history') ? 'active' : ''}
                  >
                    My Orders
                  </Link>
                </li>
              )}
              {!isAuthenticated() && (
                <li id="authNavItem">
                  <Link to="/login" className="btn-nav-orange">
                    Login / Register
                  </Link>
                </li>
              )}
            </ul>


            {/* Right Side Icons - only shown when authenticated */}
            <div style={{ display: 'flex', alignItems: 'center', gap: '1.5rem' }}>
              {isAuthenticated() && (
                <>
                  {/* Notification Bell */}
                  <NotificationBell />

                  {/* Cart Icon */}
                  <div
                    className="cart-icon"
                    onClick={() => navigate('/cart')}
                    style={{ position: 'relative', cursor: 'pointer' }}
                  >
                    <img
                      src="/images/shopping-cart.png"
                      alt="Cart"
                      style={{ width: '28px', height: '28px', objectFit: 'contain' }}
                    />
                    {getCartCount() > 0 && (
                      <span className="cart-badge" id="cartCount">
                        {getCartCount()}
                      </span>
                    )}
                  </div>

                  {/* Profile Icon */}
                  <div
                    className="user-icon"
                    id="profileIcon"
                    onClick={() => navigate('/profile')}
                    style={{ cursor: 'pointer' }}
                  >
                    <img
                      src="/images/profile.png"
                      alt="Profile"
                      style={{ width: '28px', height: '28px', objectFit: 'contain' }}
                    />
                  </div>
                </>
              )}

              {/* Hamburger Menu - toggles sidebar */}
              <div
                className={`hamburger ${sidebarOpen ? 'active' : ''}`}
                id="hamburger"
                onClick={() => setSidebarOpen(!sidebarOpen)}
              >
                <span></span>
                <span></span>
                <span></span>
              </div>
            </div>

          </div>
        </div>
      </nav>

      {/* User Sidebar */}
      <UserSidebar isOpen={sidebarOpen} onClose={closeSidebar} />
    </>
  );
};

export default Navbar;
